import logo from './logo.svg';
import './App.css';
import { useState } from "react";
import VehicleOdom from './components/VehicleOdom';
import AtakStatus from './components/AtakStatus';
import INSstatus from './components/INSstatus';
import NavSat from './components/NavSat';
import SystemStatus from './components/SystemStatus';

function App() {
  const [atak, setAtak] = useState({ connected: true });

  const [gps, setGPS] = useState({ latitude: 54.211324, longitude: 45.324341 });

  const [ins, setINS] = useState({
    aligned: true,
    pos_valid: false,
    heading_valid: false,
    dvl_recv: true,
    dvl_used: false,
    lat_accuracy: 456.654,
    lon_accuracy: 854645.646,
  });

  const [sysstat, setSysstat] = useState({
    autonomy_state: 2,
    mission_loaded: true,
    mission_start: false,
    counting_down: false,
    awake: true,
  });

  return (
    <div className="app">
      <div className="cards">
        <VehicleOdom odom={odom} setOdom={setOdom}/>
        <AtakStatus atak={atak} />
        <NavSat gps={gps} />
        <INSstatus ins={ins} />
        <SystemStatus sysstat={sysstat} />
      </div>
    </div>
  );
}

export default App;
